import { combineReducers } from "redux";

const typedHouseReducer = (typedHouse = { num: 7 }, action) => {
  if (action.type !== "TYPE_OF_HOUSE") {
    return typedHouse.num;
  }

  switch (action.payload) {
    case "small":
      return (typedHouse.num = 5);
    case "middle":
      return (typedHouse.num = 7);
    case "big":
      return (typedHouse.num = 9);
  }
};

export default combineReducers({
  typedHouse: typedHouseReducer
});
